@Override
public int hashCode() {
  final int prime = 31;
  int hash = 1;
  hash = prime * hash + origParentQuery.hashCode();
  hash = prime * hash + new Boolean(doScores).hashCode();
  hash = prime * hash + parentsFilter.hashCode();
  return hash;
}

